import "./App.css";
import Galaxy from "./galaxy";

function App() {
  return (
    <div className="main">
      <main>
        <h1>◽️</h1>
        <h2>Hello world.</h2>
      </main>
      <div className="wrap-galaxy">
        <Galaxy></Galaxy>
      </div>
    </div>
  );
}

export default App;
